use crate::*;

/// Allows rui to iterate over a tuple of `Views`.
pub trait ViewTuple {
    fn foreach_view<F: FnMut(&dyn View)>(&self, f: &mut F);
    fn len(&self) -> usize;
    fn is_empty(&self) -> bool {
        false
    } // satisfy clippy

    fn draw(&self, id: ViewId, cx: &mut Context, vger: &mut Vger);
}

macro_rules! impl_view_tuple {
    ( $n: tt; $( $t:ident),* ; $( $s:tt ),* ) => {

        impl< $( $t: View, )* > ViewTuple for ( $( $t, )* ) {
            fn foreach_view<FN: FnMut(&dyn View)>(&self, f: &mut FN) {
                $( f(&self.$s); )*
            }
            fn len(&self) -> usize {
                $n
            }

            fn draw(&self, id: ViewId, cx: &mut Context, vger: &mut Vger) {
                $({
                    let child_id = id.child(&$s);
                    let layout_box = cx.layout[&child_id];
        
                    vger.save();
        
                    vger.translate(layout_box.offset);
        
                    self.$s.draw(child_id, cx, vger);
        
                    if DEBUG_LAYOUT {
                        let paint = vger.color_paint(CONTROL_BACKGROUND);
                        vger.stroke_rect(
                            layout_box.rect.min(),
                            layout_box.rect.max(),
                            0.0,
                            1.0,
                            paint,
                        );
                    }
        
                    vger.restore();
                })*
            }
        }
    }
}

